import React, { useState } from 'react'
import ReactDOM from 'react-dom'

const App = () => {
  const [persons, setPersons] = useState([
    { name: 'Arto Hellas' }
  ])
  const [newName, setNewName] = useState('')

  const handlesubmitClick = () =>
    setNewName(newName = "marrku orku")

  const morePeople = (uusi) => {
    const copy =  persons
    copy.push(uusi.name)
    setPersons(copy)
  }

  return (
    <div>
      <h2>Phonebook</h2>
      <form>
        <div>
          name: <input />
        </div>
        <div>
          <button type="submit">add</button>
          {handlesubmitClick}
        </div>
      </form>
      <h2>Numbers</h2>
      <div>
        {persons}
      </div>
    </div>
  )

}

export default App

ReactDOM.render(<App />, document.getElementById('root'))
